import cProfile
from typing import List, Dict


class Solution:
    def maximalSquare(self, matrix: List[List[str]]) -> int:
        m = len(matrix)
        n = len(matrix[0])

        min_square = 0
        max_square = min(m,n)+1

        if max_square == 1:
            for i in matrix:
                for j in i:
                    if j == "1":
                        return 1
            return 0
        
        while min_square!=max_square-1:
            current_square = int((max_square+min_square)/2)
            if self.find_square(current_square, matrix):
                min_square = current_square
            else:
                max_square = current_square
        
        return min_square**2

    def find_square(self, current_square, matrix):
        for i in range(len(matrix)-current_square+1): # shifting square
            for j in range(len(matrix[0])-current_square+1): # shifting square
                    if self.check_square(current_square, i, j, matrix):
                         return True
                    
        return False

    def check_square(self, current_square, i, j, matrix):
        
        for k in range(current_square): # check inside square
            for l in range(current_square): # check inside sqaure
                if matrix[i+k][j+l] == "1":
                    continue
                else:
                    return False
        return True

    def maybe_recursion(self, matrix):
        m = len(matrix)
        n = len(matrix[0])
        conv_matrix = []
        for i in range(m-1):
            for j in range(n-1):
                pass  

